import React from 'react';
import '../css/FreshAccount.css';
import NewTweet from './tweets/newTweet.js';


class FirstTweet extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="PromptContainer">
                <h3>Create a tweet</h3>
                <NewTweet username={this.props.username} updateTweets={this.props.updateTweets} twitterAccounts={this.props.twitterAccounts} />                
            </div>
        );
    }
}

export default FirstTweet;
